export default function Rating(props) {
  const { rating, numReviews } = props;
  let tempStar = [];

  useEffect(() => {
    const showRating = () => {
      let nStar = parseInt(rating);
      console.log(nStar);
      for (let i = 0; i < nStar; i++) {
        tempStar.push(i);
      }
    };
    showRating();
    console.log(tempStar);
  }, []);
  return <div>fg</div>;
}
